import React,{ Component } from "react";
import mapDataWorld from '@highcharts/map-collection/custom/world.geo.json'
import Chart from './components/Chart.jsx'
import MapChart from './components/Map.jsx'
import Container from './components/Container.jsx'
import mapData from './data/mapData.jsx'
import Highcharts from 'highcharts/highstock'
export default function WorldMap(props) {

    const mapOptions = {
        title: {
          text: ''
        },
        colorAxis: {
          min: 0,
          stops: [
            [0, '#EFEFFF'],
            [0.67, '#4444FF'],
            [1, '#000022']
          ]
        },
        tooltip: {
          pointFormatter: function() {
            return this.properties['woe-label'].split(',')[0];
          }
        },
        series: [{
          mapData: mapData,
          dataLabels: {
            formatter: function() {
              return this.point.properties['woe-label'].split(',')[0];
            }
          },
          name: 'World',
          data: [
           ["ALG",6],
           ["ARGN",25],
	       ["ASRA",3],
           ["AUS",27],
           ["AZER",3],
           ["BEL",4],
           ["US", 13517]
          ]
        }]
      }

          return <div>
              <h2>Highmaps</h2>
              <MapChart options={mapOptions} highcharts={Highcharts} />
          </div>

}
